import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header from './Components/Header';
import Footer from './Components/Footer';
// import Home from './components/Home';        // Add your Home component
// import Books from './components/Books';      // Add your Books component
// import AboutUs from './components/AboutUs';  // Add your AboutUs component
// import ContactUs from './components/ContactUs'; // Add your ContactUs component
import Login from './components/Login';
import Signup from './components/Signup';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <Router>
      <Header />
      <main>
        <Switch>
          <Route path="/login" component={Login} />
          <Route path="/signup" component={Signup} />
          <Route path="/books" component={Books} />
          <Route path="/about-us" component={AboutUs} />
          <Route path="/contact-us" component={ContactUs} />
          <Route path="/" exact component={Home} />
        </Switch>
      </main>
      <Footer />
    </Router>
  );
}

export default App;
